   *    可以直接通过实例对象访问
   *    this.props
   */
  render() {
    console.log(this.props)
    return (
      <ul>
        <li>姓名:张三</li>
        <li>年龄:18</li>
        <li>性别:男</li>
      </ul>
    )
  }
}
